import React from 'react'

export default function StatusBar() {
    return (
        <div style={{display: "flex", justifyContent: "space-evenly", alignItems:"center", width: "100vw", borderTop:"1px solid black", borderBottom:"1px solid black", marginBottom:"50px", padding: 0}}>
            <h1>Status Bar</h1>
            <h5 style={{backgroundColor:"orange", color:"white", fontSize: "19px", padding: "30px", margin:"11px"}}>Water</h5>
            <h5 style={{backgroundColor:"purple", color:"white", fontSize: "19px", padding: "30px", margin:"11px"}}>Watering</h5>
            <h5 style={{backgroundColor:"green", color:"white", fontSize: "19px", padding: "30px", margin:"11px"}}>Just Watered</h5>
            <h5 style={{backgroundColor:"red", color:"white", fontSize: "19px", padding: "30px", margin:"11px"}}>Must Water</h5>
        </div>
    )
}
